INSERT INTO `ricetta` (`id`, `procedimento`, `ingredienti`, `categoria`, `data`, `autore`, `id_immagine`, `nome_ricetta`, `dosi_persone`, `valutazione`) VALUES
(1, 'Per preparare gli spaghetti alla carbonara cominciate mettendo sul fuoco una pentola con lacqua salata per cuocere la pasta. Nel frattempo eliminate la cotenna dal guanciale e tagliatelo prima a fette e poi a striscioline spesse circa 1cm. La cotenna avanzata potr essere riutilizzata per insaporire altre preparazioni. Versate i pezzetti in una padella antiaderente e rosolate per circa 15 minuti a fiamma media, fate attenzione a non bruciarlo altrimenti rilascer un aroma troppo forte. Nel frattempo tuffate gli spaghetti nellacqua bollente e cuoceteli per il tempo indicato sulla confezione. Intanto versate i tuorli in una ciotola, aggiungete anche la maggior parte del pecorino previsto dalla ricetta la parte restante servir per guarnire la pasta. Insaporite con il pepe nero, amalgamate tutto con una frusta a mano. Aggiungete un cucchiaio di acqua di cottura per diluire il composto e mescolate. Intanto il guanciale sar giunto a cottura, spegnete il fuoco e tenetelo da parte. Scolate la pasta al dente direttamente nel tegame con il guanciale e saltatela brevemente per insaporirla. Togliete dal fuoco e versate il composto di uova e pecorino nel tegame. Mescolate velocemente per amalgamare. Per renderla ben cremosa, al bisogno, potete aggiungere poca acqua di cottura della pasta. Servite subito gli spaghetti alla carbonara insaporendoli con il Pecorino avanzato e il pepe nero macinato a piacere.', 'spaghetti:320 g, tuorli d\'uovo:6, guanciale:150 g, pecorino romano:50 g, pepe nero:q.b.', 'primi', '2020-08-06', 1631187867, 1, 'SPAGHETTI ALLA CARBONARA', 4, 2),
(2, 'Servitevi di una pentola capiente piena di acqua e sale grosso. Portate ad ebollizione e cuocete il riso al dente!\r\nIl riso non va sciacquato sotto acqua fredda , perde sapidit e amido, fondamentali per uninsalata di riso profumata!\r\nAppena scolato perfettamente il riso, inseritelo in una ciotola e aggiungete subito 3 cucchiai di aceto freddissimo oppure succo di limone fresco (filtrato) anchesso molto freddo. No maionese che incolla il riso e lo rende pesante.\r\nGirate bene, si abbatter subito un p la temperatura o e i chicchi si raffredderanno senza che si crei la colla. Ponete quindi in frigo.\r\nNel frattempo tagliate a pezzetti la lattuga, conditela con olio e un pizzico di sale, tenete da parte in frigo. Tagliate i pomodorini e conditeli con olio e sale. Tagliate a pezzetti le olive fresche. A questo punto, procedete per gradi per il condimento. Inserendo i vari ingredienti a poco a poco.\r\n\r\n1) Sgocciolate il tonno. Aggiungetelo nel riso e girate bene.\r\n\r\n2) Aggiungete linsalata verde e girate bene. In questa fase potete aggiungere la rucola o altra verdure a foglie verde scelta.\r\n\r\n3) ponete linsalata di riso in frigo\r\n\r\n4) In un pentolino disponete le uova, copritele di acqua, fate bollire per 5 minuti circa e aspettate che le uova diventino sode. Scolate e raffreddate sotto acqua gelida, dove eliminerete anche la buccia alle uova. Lasciate che le uova si raffreddino prima di tagliarle a fette o a spicchi. Ponetele quindi in frigo per almeno 10  15 minuti.\r\n\r\n5) Quando le uova sono ben fredde e anche il riso si  ormai raffreddato e insaporito, aggiungete le verdure miste sottolio, girate bene, le olive nere tagliate a pezzetti e infine i pomodorini conditi. Girate bene\r\n\r\n6) a questo punto se gradite, potete aggiungere la dadolata di prosciutto cotto e formaggio.\r\n\r\nSistemate linsalata di riso in una pirofila aggiungendo le uova a fette o a spicchi e guarnite con olive nere e verdi.\r\n\r\nEcco pronta linsalata di riso classica!', 'riso:320 g, tonno sott\'olio:320 g, lattuga:100 g, pomodorini piccadilly:12, verdure sott\'olio miste:350 g, olive verdi:100 g, olive nere:50 g, prosciutto cotto a dadini:80 g, formaggio a pasta filante:80 g, uova:3-4, olio:q.b., sale:q.b., aceto di mele o succo di limone:3 cucchiai', 'primi', '2021-06-17', 1631280694, 2, 'INSALATA DI RISO ', 4, 5),
(3, 'Per preparare gli spaghetti allo scoglio cominciate dalla pulizia di cozze e vongole. Queste ultime dovrete sciacquarle pi volte sotto acqua corrente e poi farle stare in ammollo in acqua fredda. Intano pulite le cozze: raschiate via le impurit pi resistenti con la lama di un coltellino, strappate via il bisso, cio la parte barbetta che fuoriesce, poi aiutatevi con una paglietta dacciaio nuova pulite bene il guscio. Prima di cuocere, battete una ad una le vongole su un tagliere o nel lavandino con il taglio della conchiglia rivolto verso il basso: se noterete sabbia andr scartata. Scaldate l\'olio in un tegame piuttosto capiente e quando sar ben caldo versate le vongole e le cozze, coprite subito con un coperchio e attendete fin quando non sono completamente dischiuse, ci vorranno 3-4 minuti. Una volta aperte le cozze e vongole togliete il coperchio, versatele in un recipiente, non gettate il liquido di cottura ma filtratelo per eliminare eventuali impurit e residui di sabbia. Tenetelo da parte in caldo. Sgusciate sia le vongole che le cozze tenendo da parte alcuni molluschi con guscio per guarnire il piatto. Se non li utilizzate gi puliti, potete dedicarvi alla pulizia dei calamari: dovrete eliminare la testa e le interiora, successivamente poi togliete via la pelle e incidete solo la parte superficiale, potrete aiutarvi entrando con la lama nel suo interno, fino ad aprirlo completamente. dopodich tagliatelo a listarelle. Passate agli scampi: con le forbici tagliate sui lati della coda eliminando cos la corazza che ricopre laddome. Poi con uno stuzzicadenti cercate di eliminare l\'intestino, il filetto nero presente nello scampo. In questo modo non rilascer un sapore amaro. Eliminate solo la corazza e conservate testa e chele. Infine lavate i pomodorini e tagliateli a spicchi. Mettete a bollire l\'acqua per la pasta, da salare a bollore. Intanto rosolate spicchio daglio con olio, quando sar imbiondito versate i calamari insieme ad un pizzico di sale. Cuocete 5 minuti poi sfumate con il vino bianco. Lasciate evaporare lalcol, eliminate laglio e aggiungete i pomodorini. Cuocete ancora 5 minuti. A questo punto potete iniziare la cottura degli spaghetti che saranno da scolare molto al dente. Aggiungete anche gli scampi al sugo, salate e pepate. Scolate direttamente in padella gli spaghetti, quando mancano 5 minuti al termine della cottura. Proseguite la cottura versando al bisogno lacqua di cottura di cozze e vongole che avete tenuto da parte. Per ultime aggiungete anche le cozze e le vongole con guscio e senza. A fine cottura spegnete il fuoco, insaporite con il prezzemolo tritato e mescolate unultima volta. Servite gli spaghetti allo scoglio ben caldi.\r\n', 'spaghetti:320 g, vongole:1 kg, scampi:8, cozze:1 kg, calamari:300 g, pomodorini ciliegino:300 g, olio:4 cucchiai, prezzemolo:1 ciuffo, sale:q.b., aglio:1 spicchio, vino bianco:40 g, pepe nero:q.b.', 'primi', '2021-08-16', 1631285760, 3, 'SPAGHETTI ALLO SCOGLIO ', 4, 0),
(4, 'Per preparare gli gnocchi di patate cominciate lessando queste ultime: in una pentola capiente sistemate le patate e coprite con abbondante acqua fredda. Dal momento in cui lacqua sar a bollore contate circa 30-40 minuti, a seconda della loro grandezza. Fate la prova forchetta e se i rebbi entreranno senza difficolt nel mezzo allora potrete scolarle. Schiacciate le patate mentre sono ancora calde sulla farina che avrete setacciato sulla spianatoia e che avrete disposto a fontana; non ci sar bisogno di sbucciarle perch la buccia rimarr all\'interno dello schiacciapatate. Aggiungete poi luovo leggermente battuto insieme a un pizzico di sale. Impastate il tutto con le mani fino ad ottenere un impasto morbido ma compatto. Ricordate che se li lavorerete troppo gli gnocchi diventeranno duri durante la cottura, quindi limitatevi ad impastare il tempo necessario. Prelevate una parte di impasto e stendetelo con le punte delle dita per ottenere dei filoncini spessi 2 cm; per farlo aiutatevi infarinando la spianatoia, di tanto in tanto, con della semola. Nel frattempo, coprite l\'impasto rimanente con un canovaccio per evitare che si secchi. Tagliate i filoncini a tocchetti e, facendo una leggera pressione con il pollice, trascinateli sul riga-gnocchi per ottenere la classica forma. Se non avete il riga-gnocchi potete utilizzare una forchetta e trascinarli sui rebbi; anche in questo caso, utilizzate la farina di semola per evitare che si appiccichino. Man a mano che preparate gli gnocchi di patate sistemateli su un vassoietto con un canovaccio leggermente infarinato, ben distanziati l\'uno dall\'altro. Se intendete cuocerli potrete versarne pochi per volta in acqua bollente e salata; non appena verranno a galla gli gnocchi si ritengono cotti e quindi pronti per essere scolati e conditi.', 'patate rosse:1 kg, uova:1, semola di grano duro rimacinata:q.b., farina 00:300 g, sale fino:q.b. ', 'primi', '2021-08-04', 1631187867, 4, 'GNOCCHI DI PATATE', 4, 0),
(5, 'Per preparare lo spezzatino di manzo cominciate mettendo sul fuoco una pentola con il brodo di carne e lasciate in caldo (ve ne serviranno circa 2-2,5 l ma potete prepararlo in abbondanza e in caso congelare quello che non userete). Intanto proseguite pulendo sedano, carota e cipolla e sminuzzate le verdure in modo da ottenere dei cubetti di 5-6 mm. Legate insieme timo, salvia e rosmarino con un pezzetto di spago da cucina. Infine tagliate la carne a cubotti della grandezza di 4-5 cm.\r\nIn una casseruola mettete a scaldare il burro con lolio. Non appena il fondo sar caldo aggiungete il trito di sedano, carota e cipolla e lasciate insaporire a fuoco dolce per una decina di minuti; al bisogno potete aggiungere pochissimo brodo caldo. Quando il trito  ben appassito, aggiungete la carne, alzate la fiamma e lasciate sigillare per bene tutti i pezzi per una decina di minuti, regolate di sale e pepe, dopodich spolverizzate con la farina lasciandola tostare per un paio di minuti: fate molta attenzione perch potrebbe bruciare, quindi mescolate spesso. Sfumate con il vino rosso e lasciate evaporare completamente, poi aggiungete il mazzetto odoroso e coprite con il brodo di carne caldo.\r\nCoprite con il coperchio e lasciate cuocere a fuoco medio per almeno 2 ore, avendo cura di mescolare di tanto in tanto e controllare se servir di aggiungere altro brodo al bisogno perch non si asciughi eccessivamente. A fine cottura rimuovete il mazzetto odoroso e assicuratevi che lo spezzatino di manzo sia giusto di sale. A questo punto non vi resta che servire il vostro spezzatino di manzo! ', 'carne bovina:1 kg, cipolla:1, sedano:1, olio:4 cucchiai, farina 00:30 g, timo:1 rametto, pepe nero:q.b., brodo di carne:2,5 l, carote:1, vino rosso:1 bicchiere, burro:30 g, rosmarino:1 rametto, salvia:3 foglie, sale fino:q.b.', 'secondi', '2021-07-20', 1631280694, 5, 'SPEZZATINO DI MANZO', 4, 0),
(6, 'Per preparare lo stinco alla birra iniziate pulendo le cipolle, affettatele non troppo sottili e versatele in un tegame largo e dai bordi alti con un fondo d\'olio. Rosolate a fuoco medio basso profumando con rosmarino e alloro. Nel frattempo salate e pepate gli stinchi di maiale. Versate poco olio in una padella d\'acciaio e fate sigillare gli stinchi a fiamma medio alta prima da un lato e poi dall\'altro: ricordate che per rigirare la carne  sempre bene usare delle pinze o dei cucchiai di legno. Aggiustate di sale le cipolle e a questo punto trasferite gli stinchi sigillati. Nella padella dove avete scottato la carne, rimuovete il grasso in eccesso e deglassate il fondo con la birra. Raschiate bene il fondo con un cucchiaio di legno e fate bollire il tutto per circa 5 minuti cos da addensarsi un po\'. Trasferite il liquido nel tegame con gli stinchi. Versate anche il brodo di carne caldo e coprite con il coperchio lasciando cuocere a fiamma bassa per circa 3 ore e mezza. Terminato il tempo di cottura mettete la carne in un recipiente e coprite con la pellicola per non farla seccare. Togliete alloro e rosmarino dal fondo di cottura e frullate la salsa con laiuto di un miniprimer. Mentre fate questa operazione versate anche il burro freddo a pezzetti, cos non si separer dalla salsa, e lasciatelo incorporare. Aggiustate eventualmente di sale e ricongiungete con la carne. ', 'stinco di maiale:1,25 kg, brodo di carne:400 g, alloro: 1 foglia, burro:40 g, sale:q.b., cipolle dorate:300 g, birra chiara:1 l, rosmarino:1 rametto, olio:q.b., pepe nero:q.b.', 'secondi', '2021-08-21', 1631285591, 6, 'STINCO ALLA BIRRA', 3, 0),
(7, 'Per preparare i cheeseburger iniziate a grigliare su una piastra ben calda le fettine di bacon, girandole a met cottura. Dovranno diventare dorate e croccanti. Quando sono pronte tenetele in caldo.\r\nSulla stessa piastra (senza lavarla) cuocete anche gli hamburger, girateli quando saranno cotti sul primo lato e pressateli un po\' con una spatola per farli cuocere bene anche in profondit. Quando sono quasi pronti adagiatevi sopra le fettine di formaggio cheddar, ed aspettate che si inizi a sciogliere leggermente.\r\nNel frattempo affettate in maniera sottile la cipolle, lavate ed affettate anche i pomodori.\r\nPrendete i panini e tagliateli a met, quindi iniziate ad assemblare il panino sistemando prima una foglia di insalata, quindi l\'hamburger, la maionese, cipolla e pomodoro, maionese e bacon. Ora potete richiudere il panino con la calotta superiore.\r\nIl vostro cheeseburger  pronto per essere servito!', 'panini per hamburger:2, hamburger:2, bacon a fettine:4, cheddar:2 fette, insalata:2 foglie, pomodoro:1, cipolla:1/2, salse a piacere', 'secondi', '2021-07-31', 1631280694, 7, 'CHEESEBURGER', 2, 0),
(8, 'Per preparare lorata al forno si parte dalla pulizia dellorata: con una forbice tagliate le pinne, poi desquamatela sotto lacqua corrente utilizzando il dorso di coltello o, se lavete, con lapposito attrezzo per desquamare il pesce oppure con la lama di un coltello. Con un paio di forbici praticate un taglio sul ventre dellorata, procedendo dritto fino a sotto la testa. A questo punto levate le interiora e sciacquate bene lorata sotto lacqua corrente per eliminare le impurit. Riempite la cavit con i rametti di rosmarino, i rametti di timo, i due spicchi d\'aglio scamiciati, salate e pepate e aggiungete da ultimo due fette di limone. Mettete l\'orata da parte per un momento e passate alle patate: lavatele e sbucciatele con un pelapatate, poi tagliatele a fettine molto sottili con una mandolina. Mettete le patate in una ciotola e condite con olio e origano secco. Aggiungete anche i fiocchi di sale e mescolate bene. Prendete una teglia da forno versate le fettine di patate, lasciando un p di spazio al centro e cercando di non sovrapporle eccessivamente, in modo che diventino ben croccanti durante la cottura. Adagiate l\'orata al centro della teglia, accanto alle patate. Aggiungete un ultimo filo dolio e infornate a 180 per 40 minuti (forno statico). Sfornate e rimuovete dalla pancia dellorata tutti gli odori, il limone e laglio. La vostra orata al forno  pronta per essere sfilettata e servita!\r\n\r\n', 'orata:900 g, patate:400 g, aglio:2 spicchi, timo:1 rametto, limoni:2 fette, pepe nero:q.b., olio extravergine di oliva:40 g, rosmarino:1 rametto, sale fino:q.b., fiocchi di sale:q.b.', 'secondi', '2021-07-14', 1631285591, 8, 'ORATA AL FORNO', 2, 0),
(9, 'Per preparare i muffin con gocce di cioccolato lavorate con le fruste elettriche il burro, lasciato ammorbidire a temperatura ambiente per almeno unora precedentemente, con lo zucchero, fino ad ottenere un composto spumoso e cremoso. Dopodich incidete una bacca di vaniglia e raschiate i semi utilizzando il dorso di un coltello. Versate questi ultimi nella ciotola con burro e zucchero. Azionate nuovamente le fruste e aggiungete le uova, anche queste a temperatura ambiente, una alla volta in questo modo gli ingredienti non si slegheranno. Ora setacciate la farina, il lievito per dolci ed il bicarbonato direttamente nella ciotola con il composto. Aggiungete anche il pizzico di sale e azionate nuovamente le fruste per inglobate le polveri. Noterete che limpasto diventer pi consistente quindi stemperatelo con il latte a temperatura ambiente versato a filo. A questo punto il composto sar morbido e compatto. Unite 80 grammi di gocce di cioccolato e mescolate con una spatola per inglobarle dopodich trasferite il composto in una sc-a-poche usa e getta senza bocchetta in questo modo potrete effettuare un lavoro pi pulito altrimenti utilizzate pure un cucchiaio. Sistemate i pirottini di carta in una pirofila da muffin e riempiteli per 2/3, quindi lasciando meno di un centimetro dalla superficie. Ogni muffin dovr pesare allincirca 70 grammi. Sulle tortine versate le rimanenti 20 gocce di cioccolato e cuocete in forno preriscaldato a 180 per 18-20 minuti in modalit statica (altrimenti a 160 per 13-15 minuti se il forno  ventilato). A questo punto i vostri muffin con gocce di cioccolato sono pronti per essere gustati!', 'burro:125 g, zucchero:135 g, uova:2, baccello di vaniglia:1, sale fino:1 pizzico, farina 00:265 g, latte intero:135 g, gocce di cioccolato fondente:100 g, bicarbonato:1 cucchiaino, lievito in polvere per dolci:10 g', 'dessert', '2021-09-01', 1631285760, 9, 'MUFFIN CON GOCCE DI CIOCCOLATO', 4, 5),
(10, 'Per preparare la New York cheesecake, per prima cosa fondete il burro e lasciatelo intiepidire; nel frattempo ponete i biscotti in un mixer e frullateli fino a ridurli in polvere. Poi trasferiteli in una ciotola e versate il burro. Mescolate con un cucchiaio fino ad uniformare il composto; prendete poi uno stampo a cerniera da 22 cm e foderate la base con la carta forno. Ponete met dei biscotti all\'interno e schiacciateli con il dorso del cucchiaio per compattarli. \r\nPoi utilizzando i biscotti rimanenti foderate anche il bordo dello stampo. Non appena avrete ricoperto l\'intera superficie ponete la base della vostra New York cheesecake a rassodare in frigorifero per 30 minuti, oppure in freezer per 15 minuti.\r\nNel frattempo occupatevi di preparare la crema: in una ciotola rompete un uovo, aggiungete un tuorlo, lo zucchero e sbattete il tutto con una frusta fino ad ottenere una crema. Prelevate i semi di una mezza bacca di vaniglia (tenendo da parte il resto che servir successivamente) e poneteli insieme alle uova. Aggiungete anche il formaggio cremoso poco per volta e continuate a mescolare con una frusta. Non appena avrete incorporato tutto il formaggio, aggiungete anche il succo di limone e l\'amido di mais. Unite poi la panna e mescolate ancora delicatamente con la frusta. Riprendete dal frigorifero la base di biscotti e versate il composto all\'interno.\r\nLivellate leggermente la superficie e cuocete in forno statico preriscaldato a 160 per 60 minuti, poi proseguite la cottura a 170 per altri 20 minuti. Una volta cotta, lasciate raffreddare la cheesecake nel forno spento con lo sportello aperto e nel frattempo occupatevi del topping. In una ciotola, unite la panna acida con i semi della mezza bacca di vaniglia tenuta da parte e amalgamate il tutto con una spatola.\r\nVersate il topping sulla cheesecake a temperatura ambiente e spalmatelo uniformemente, poi riponetela nuovamente in frigorifero a riposare per 2 ore. Trascorso il tempo di riposo, sformate il dolce e occupatevi della decorazione: aggiungete prima i ribes, poi le more, i mirtilli e i lamponi. In ultimo aggiungete le foglioline di menta e servite la vostra favolosa New York cheesecake! ', 'biscotti digestive:240 g, burro:110 g\r\n\r\nformaggio fresco spalmabile:500 g, panna fresca liquida:100 g, zucchero:65 g, amido di mais:25 g, uova:1, tuorlo d\'uovo:1, succo di limone:1/2, baccello di vaniglia:1/2\r\n\r\npanna acida:100 g, menta:q.b., frutti di bosco:q.b., baccello di vaniglia:1/2', 'dessert', '2021-09-01', 1631285591, 10, 'CHEESECAKE AMERICANA', 8, 0),
(11, 'Per realizzare il tiramis alle fragole lavate le fragole e poi togliete il picciolo, quindi tagliatele a rondelle e versatele in ciotola, aggiungete i 20 g di zucchero semolato. Unite anche 20 g di succo di limone. Mescolate e lasciate macerare le fragole sino allutilizzo. In un pentolino versate 50 g di acqua. Unite 125 g di zucchero e scaldate a fuoco moderato. Misurate con un termometro da cucina che la temperatura arrivi esattamente a 121. E\' preferibile usare il termometro per maggior precisione ma se non lo possedete, potete verificare quando lo sciroppo  pronto se vedrete delle bollicine bianche in superficie. Quando il termometro segner 115 circa, iniziate a lavorare i tuorli in una ciotola con lo sbattitore elettrico. \r\nUna volta che lo sciroppo avr raggiunto i 121, versatelo a filo sui tuorli, continuando a lavorare con le fruste, fino ad ottenere un composto chiaro e spumoso e fino a completo raffreddamento. \r\nVersate il mascarpone in una ciotola e unite poco composto di uova inizialmente, mescolando energicamente con una frusta, poi versate il resto e amalgamate fino ad ottenere una crema al mascarpone cremosa e omogenea. Lasciatela rassodare in frigorifero coperta con pellicola per 30 minuti e nel frattempo proseguite con il resto della preparazione. \r\nRiprendete le fragole e filtratele. Prelevate 1/3 delle fragole a rondelle e versatele in un bicchiere alto, aggiungete il succo filtrato e frullate tutto con un mixer ad immersione. Versate la salsa in una ciotola larga. Tagliate a met i savoiardi o potete spezzarli a seconda della misura dei vostri bicchieri o contenitori. Trasferite la crema rassodsata nel sac--poche.\r\nOra potete comporre il vostro tiramis alle fragole avendo a disposizione: la ciotolina con la salsa di fragole in cui intingere da un lato e dall\'altro i savoiardi. Prendete un bicchiere della capacit di circa 300 ml, coprite il fondo con uno strato di crema, poi adagiate 1 met di biscotto intinto nella salsa alle fragole, quindi qualche pezzetto di fragola. Create ancora due strati di crema al mascarpone come fatto in precedenza, sistemando i savoiardi in base alla grandezza del bicchiere (potete utilizzarne solo un pezzo o anche 1 e mezzo o due). Terminate con uno strato di crema e decorate la superficie con le fragoline tenute da parte. Il tiramis alle fragole  pronto per essere servito.', 'mascarpone:400 g, acqua:50 g, tuorli:3, zucchero:125 g\r\nfragole:400 g, zucchero:20 g, savoiardi:8, succo di limone:20 g\r\n\r\nfragole:12', 'dessert', '2021-08-04', 1631285591, 11, 'TIRAMISU` ALLE FRAGOLE', 4, 5);

